function Counter({count}){
   
    return (

        <div>
            <h2>Counter</h2>
            <h3>0</h3>
            <button onClick={count+1} data-testid = "add-btn">+</button>
            <button onClick={count-1} data-testid = "subtract-btn">-</button>
            <button onClick={count*2} data-testid = "double-btn">Double</button>
        </div>

    )
}
export default Counter
